export function Initialize() {
	device.log("Initializing Device...");

	Corsair_Set_Mode(Corsair.softwareMode);
	
	setMacroKeys();

	Corsair.OpenEndpoint(Corsair.endpoint.lightingController, Corsair.handles.lighting);

	device.log(`Vid: ${Corsair.FetchProperty(Corsair.property.vid).toString(16)}`);
	device.log(`Pid: ${Corsair.FetchProperty(Corsair.property.pid).toString(16)}`);

	let layout = Corsair.FetchProperty(Corsair.property.layout);
	device.log(`Layout: ${Corsair.layouts[layout]}`);

	let pollingRate = Corsair.FetchProperty(Corsair.property.pollingRate);
	device.log(`Polling Rate: ${Corsair.pollingRates[pollingRate]}`);

	Corsair.FetchFirmware();
	device.log(`Developed on Firmware ${DevFirmwareVersion}`);

	

	Corsair.SetHWBrightness(1000);

	
}


