function UpdateRGB(shutdown = false){

	let [RGBData] = GetColors(shutdown);
	RGBData = [0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00 ].concat(RGBData);
	RGBData = RGBData.concat([0x00, 0x00]);
	Corsair.SendRGBData(RGBData, RGBData.length/3, Device_Write_Length);
}

