//Device Constants
const Device_Write_Length = 1025;
const Device_Read_Length = 64;
const Device_LedCount = 185; // Used for Protocol Specific Commands

const DevFirmwareVersion = "1.1.16"; //Tested up to 1.2.18

// Protocol Constants

// Command Ids
const CORSAIR_COMMAND = 0x08;

const CORSAIR_COMMAND_CHECKENDPOINT = 0x09;
const CORSAIR_COMMAND_OPENENDPOINT = 0x0D;

//Error Checking
const CORSAIR_RETURN_ERROR = 0x03;
const CORSAIR_RETURN_ERROR_OFFSET = 0x03;


// Response Values
const CommandDict = {
	0x06: "Send Command",
	0x0d: "Open Endpoint",
	0x05: "Close Endpoint",
	0x06: "Fan RPM",
	0x09: "Fan Settings",
	0x0F: "Led Settings"
};


function Corsair_Set_Mode(mode){
	let CurrentMode = Corsair.FetchProperty(Corsair.property.mode);

	// Bash Handles and reopen as needed
	Corsair.CloseEndpoint(Corsair.handles.lighting);
	Corsair.CloseEndpoint(Corsair.handles.background);

	if(CurrentMode !== mode) {
		device.log(`Setting Device Mode to ${mode === Corsair.softwareMode ? "Software" : "Hardware"}`);
		Corsair.SetProperty(Corsair.property.mode, mode);
		CurrentMode = Corsair.FetchProperty(Corsair.property.mode);
		device.log(`Mode is Now ${CurrentMode === Corsair.softwareMode ? "Software" : "Hardware"}`);
	}
}


