class ModernCorsairProtocol{
	constructor() {
		this.command = 0x08;
		this.set = 0x01;
		this.get = 0x02;
		this.closeEndpoint = 0x05;
		this.write = 0x06;
		this.stream = 0x07;
		this.read = 0x08;
		this.checkEndpoint = 0x09;
		this.openEndpoint = 0x0D;
		this.hardwareMode = 0x01;
		this.softwareMode = 0x02;

		this.property = {
			pollingRate: 0x01,
			brightness: 0x02,
			mode: 0x03,
			angleSnap: 0x07,
			batteryLevel: 0x0F,
			batteryStatus: 0x10,
			vid: 0x11,
			pid: 0x12,
			firmware:0x13,

			dpiX: 0x21,
			dpiY: 0x22,
			layout: 0x41,

		};
		this.endpoint = {
			lighting: 0x01,
			macro: 0x02,
			fanRpm: 0x17,
			fanSpeed: 0x18,
			fanStates: 0x1A,

			ledCount_3Pin: 0x1D,
			ledCount_4Pin: 0x1E,

			TemperatureData: 0x21,
			lightingController: 0x22,
		};
		this.softwareModes = {
			hardware: 0x01,
			software: 0x02,
		};
		this.responses = {
			firmware: 0x02,
			command: 0x06,
			openEndpoint: 0x0d,
			closeEndpoint: 0x05,
			getRpm: 0x06,
			fanconfig: 0x09,
			temperatureData: 0x10,
			LedConfig: 0x0F,
		};
		this.handles = {
			lighting: 0x00,
			background: 0x01,
			macro: 0x00
		};
		this.fanState = {
			disconnected: 0x01,
			Initializing: 0x04,
			connected: 0x07,
		};
		this.fanType = {
			QL: 0x06,
			SpPro: 0x05

		};
		this.pollingRates = {
			1 : "125hz",
			2 : "250hz",
			3 : "500hz",
			4 : "1000hz",
		};
		this.layouts = {
			1 : "ANSI",
		};

	}


	FetchFirmware(){
		let data = Corsair.ReadPacket(this.property.firmware);

		if(this.CheckError(data, "FetchFirmware")){
			return;
		}

		let firmwareString = `${data[4]}.${data[5]}.${data[6]}`;
		device.log(`Firmware Version: ${firmwareString}`);

		return firmwareString;
	}

	CheckError(Data, Context){
		let isError = Data[3] === 3;

		if(isError){
			device.log(`${Context} Packet Error!`);
			Initialize();
		}

		return isError;
	}
	FetchProperty(property) {
		let packet = [0x00, this.command, this.get, property, 0x00];
		device.write(packet, Device_Write_Length);
		packet = device.read(packet, Device_Read_Length);

		if(this.CheckError(packet, `GetProperty(${property})`)){
			return;
		}

		return packet[4] | (packet[5] << 8);
	}

	SetProperty(property, value) {
		let packet = [0x00, this.command, this.set, property, 0x00, (value & 0xFF), (value >> 8 & 0xFF)];
		device.write(packet, Device_Write_Length);
		packet = device.read(packet, Device_Read_Length);

		this.CheckError(packet, `SetProperty(${property})`);
	}

	ReadPacket(property) {
		let packet = [0x00, this.command, this.get, property, 0x00];
		device.write(packet, Device_Write_Length);
		packet = device.read(packet, Device_Read_Length);

		if(this.CheckError(packet, `ReadPacket(${property})`)){
			return;
		}

		return packet;
	}

	OpenEndpoint(endpoint, index = 0) {
		let packet = [0x00, this.command, this.openEndpoint, index, endpoint];
		device.write(packet, Device_Write_Length);
		packet = device.read(packet, Device_Read_Length);

		this.CheckError(packet, `OpenEndpoint`);
	}

	CloseEndpoint(endpoint) {
		let packet = [0x00, this.command, this.closeEndpoint, 1, endpoint];
		device.write(packet, Device_Write_Length);
		packet = device.read(packet, Device_Read_Length);

		this.CheckError(packet, `CloseEndpoint`);

	}

	ReadEndpoint(Endpoint, Index, Command) {

		this.OpenEndpoint(Endpoint, Index);
		//device.write([0x00, 0x09, 0x08, Index], Device_Write_Length);
		//device.read([0x00], Device_Read_Length);

		device.write([0x00, this.command, this.read, Index], Device_Write_Length);

		let Data = [];
		Data = device.read([0x00], Device_Read_Length);

		let RetryCount = 4;

		do {
			RetryCount--;
			device.write([0x00, this.command, this.read, Index], Device_Write_Length);
			Data = device.read(Data, Device_Read_Length);

			if(CommandDict[Data[4]] !== CommandDict[Command]) {
				device.log(`Invalid Command Read: Got [${CommandDict[Data[2]]}][${Data[4]}], Wanted [${CommandDict[Command]}][${Command}]`);
			}

		} while(CommandDict[Data[4]] !== CommandDict[Command] && RetryCount > 0);

		this.CloseEndpoint(Index);

		return Data;
	}

	WriteEndpoint(Endpoint, Index, Command, Data) {
		this.OpenEndpoint(Endpoint, Index);

		device.write([0x00, this.command, this.read, Index], Device_Write_Length);
		device.read([0x00], Device_Read_Length);

		device.write(Data, Device_Write_Length);

		let packet = device.read([0x00], Device_Read_Length);

		this.CheckError(packet, `WriteEndpoint(Endpoint, Index)`);

		this.CloseEndpoint(Index);
	}

	SendRGBData(RGBData, LedCount, PacketSize){
        let BytesSent = 0;
        let TotalBytes = LedCount * 3;
        let BytesPerPacket = PacketSize - 4;

        while(TotalBytes > 0){
            let BytesToSend = Math.min(BytesPerPacket, TotalBytes);

            if(BytesSent === 0){
                if(BytesPerPacket < TotalBytes){
                    BytesToSend -= 6;
                }

                this.WriteLighting(RGBData.length, RGBData.splice(0, BytesToSend));
            }else{
                this.StreamLighting(RGBData.splice(0, BytesToSend));
            }

            TotalBytes -= BytesToSend;
            BytesSent += BytesToSend;
        }
    }

	WriteLighting(LedCount, RGBData){
		let packet = [];
		packet[0x00] = 0x00;
		packet[0x01] = this.command;
		packet[0x02] = this.write;
		packet[0x03] = 0x00;
		packet[0x04] = (LedCount) & 0xFF;
		packet[0x05] = (LedCount) >> 8;
		packet[0x06] = 0x00;
		packet[0x07] = 0x00;
		packet[0x08] = 0x12;
		packet[0x09] = 0x00;
		packet = packet.concat(RGBData);

		device.write(packet, Device_Write_Length);

		let response = device.read([0x00], Device_Read_Length);

		this.CheckError(response, "WriteLighting");
	}

	StreamLighting(RGBData) {

		let packet = [];
		packet[0x00] = 0x00;
		packet[0x01] = this.command;
		packet[0x02] = this.stream;
		packet[0x03] = 0x00;
		packet = packet.concat(RGBData);

		device.write(packet, Device_Write_Length);

		let response = device.read([0x00], Device_Read_Length);

		this.CheckError(response, "StreamLighting");
	}

	SetHWBrightness(Brightness){
		let HardwareBrightness = this.FetchProperty(this.property.brightness);

		if(HardwareBrightness !== Brightness){
			device.log(`Hardware Level Brightness is ${HardwareBrightness/10}%`);

			this.SetProperty(this.property.brightness, Brightness);
			device.log(`Hardware Level Brightness is now ${this.FetchProperty(this.property.brightness)/10}%`);
		}
	}

	FetchFanRPM() {
		let data = Corsair.ReadEndpoint(this.endpoint.fanRpm, this.handles.background, 0x06);
		let FanSpeeds = [];

		if(data[4] !== 6 && data[5] !== 0) {
			device.log("Failed to get Fan RPM's", {toFile: true});
		}
		let fanCount = data[6];
		let fanSpeeds = data.slice(7, 7 + 2 * fanCount);

		for(let i = 0; i < fanCount; i++) {
			let fanData = fanSpeeds.splice(0, 2);
			let fanRPM = fanData[0] + (fanData[1] << 8);

			FanSpeeds[i] = fanRPM;
		}

		return FanSpeeds;
	}
	FetchFanStates() {

		if(device.fanControlDisabled()) {
			return [];
		}

		let data = this.ReadEndpoint(this.endpoint.fanStates, this.handles.background, 0x09);

		if(data[4] !== 9 || data[5] !== 0) {
			device.log("Failed to get Fan Settings", {toFile: true});

			return [];
		}

		let FanCount = data[6];
		let FanData = data.slice(7, 7 + FanCount);

		return FanData;
	}

	SetFanType() {
		// Configure Fan Ports to use QL Fan size grouping. 34 Leds
		let FanSettings = [0x00, 0x08, 0x06, 0x01, 0x11, 0x00, 0x00, 0x00, 0x0D, 0x00, 0x07];
		let offset = 11;

		for(let iIdx = 0; iIdx < 7; iIdx++) {
			FanSettings[offset + iIdx * 2] = 0x01;
			FanSettings[offset + iIdx * 2 + 1] = iIdx === 0 ? 0x01 : this.fanType.QL; // 1 for nothing, 0x08 for pump?
		}

		this.OpenEndpoint(this.endpoint.ledCount_4Pin, this.handles.background);

		device.write(FanSettings, Device_Write_Length);
		device.read([0x00], Device_Read_Length);

		this.CloseEndpoint(this.handles.background);

		//sendPacketString("00 08 15 01", Device_Write_Length); //apply changes
	}

	FetchTemperatures() {
		//device.log(`Reading Temp Data`);

		let data = Corsair.ReadEndpoint(this.endpoint.TemperatureData, this.handles.background, 0x16);
		let ProbeTemps = [];

		if(data[4] === Corsair.responses.temperatureData && data[5] === 0) {
			let ProbeCount = data[6];
			let TempValues = data.slice(7, 7 + 3 * ProbeCount);

			for(let i = 0; i < data[6]; i++) {
				let probe = TempValues.slice(i * 3 + 1, i * 3 + 3);
				let temp = Convert_To_16Bit(probe) / 10;

				ProbeTemps[i] = temp;
			}
		}

		return ProbeTemps;
	}
};
let Corsair = new ModernCorsairProtocol();

// Helper Functions
function Convert_From_16Bit(value, LittleEndian = false) {
	let returnValue = [];

	while(value > 0){
		returnValue.push(value & 0xFF);
		value = value >> 8;
	}

	return LittleEndian ? returnValue : returnValue.reverse();
}

function Convert_To_16Bit(values) {
	let returnValue = 0;

	for (let i = 0; i < values.length; i++) {
		returnValue += values[i] << (8 * i);
	}

	return returnValue;
}

function hexToRgb(hex) {
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}

